    self.view.refreshBinding('custom.Data')

except Exception as e:
    gpa.frontEnd.localUI.throwError(e)
else:
	gpa.frontEnd.localUI.throwSuccess('Schedule unlocked')

try:
    selectedRowData = self.props.selection.data

    if len(selectedRowData) == 0: raise Exception('Please select a row first!')

    queryPath = 'app/Schedule/lockScheduleByID'
    schID = int(scheduleID)
    isLocked = selectedRowData[0].isLocked

    if int(isLocked) == 1: raise Exception('Schedule is already locked.')

    params = {'scheduleID': schID}
    res = system.db.runNamedQuery(queryPath, params)
    if res != -1: raise Exception('Could not lock the schedule')

    self.view.refreshBinding('custom.Data')

except Exception as e:
    gpa.frontEnd.localUI.throwError(e)
else:
	gpa.frontEnd.localUI.throwSuccess('Schedule locked')

try:
	selectedRowData = self.props.selection.data

	if len(selectedRowData) == 0: raise Exception('Please select a row first!')

	seq = self.props.selection.data[0].AdjScheduleQueue
	schedID = self.props.selection.data[0].ID
	lineID = self.props.selection.data[0].LineID
	popupPath = 'App/OEE/Operations/LineDashboard/Schedule/Embedded/Popups/MoveDeleteWorkOrder'

	if int(seq) <= 4: raise Exception("Current work order up to sequence 4 can't be moved.")
	else:
		system.perspective.print('Begin move workorder')
		params = { 'RowData': selectedRowData, 'ModalName': 'MoveWO', 'Type': 'move' }	
		system.perspective.openPopup('MoveWO', popupPath, params)			

except Exception as e:
	gpa.frontEnd.localUI.throwError(e)

try:
    if self.view.custom.MoveSelected:
    	self.parent.parent.getChild("Row1").getChild("MoveMessage").meta.visible = False
        selectedRowData = self.props.selection.data
        ds = self.view.custom.Data

        if len(selectedRowData) == 0:
            raise Exception('Please select a row first!')

        popupPath = 'App/OEE/Operations/LineDashboard/Schedule/Embedded/Popups/MoveDeleteWorkOrder'
        selectedRow = self.view.custom.SelectedRow
        previousRow = self.view.custom.PreviousRow
        previousID = self.view.custom.PreviousSelection
        lineID = self.view.custom.LineID
        seq = self.props.selection.data[0].AdjScheduleQueue

        if previousRow is None or previousRow == '':
            raise Exception('Previous row is not selected')

        previousSeq = ds.getValueAt(int(previousRow), 'AdjScheduleQueue')
        if previousSeq is None or previousSeq == '':
            raise Exception('Previous sequence is empty or invalid')

        if int(previousSeq) <= 4 or int(seq) <= 4:
            raise Exception("Current work order up to sequence 4 can't be moved.")
        else:
            if previousID < 0:
                raise Exception('Something went wrong')
            else:
                moveParams = {
                    'schedID': previousID,
                    'lineID': lineID,
                    'seq': seq
                }
                res = mes.schedule.sp.fb_resequenceSchedule(moveParams)
                if res != True:
                    raise Exception('Could not move work order')

                data = []
                json = gpa.data.datasetToJson(ds)
                for j in json:
                    if j['ID'] == previousID:
                        data.append(j)

                params = {
                    'RowData': data, 
                    'ModalName': 'MoveWO', 
                    'Type': 'move',
                    'MoveParams': moveParams
                }   
                system.perspective.openPopup('MoveWO', popupPath, params)    
                system.perspective.sendMessage('refreshCurrentSchedule')
    else:
        raise Exception('You must enable move first')

except Exception as e:
    gpa.frontEnd.localUI.throwError(e)
finally:
	self.view.custom.MoveSelected = False

try:
	selectedRowData = self.props.selection.data

	if len(selectedRowData) == 0: raise Exception('Please select a row first!')

	seq = self.props.selection.data[0].AdjScheduleQueue
	schedID = self.props.selection.data[0].ID
	lineID = self.props.selection.data[0].LineID
	popupPath = 'App/OEE/Operations/LineDashboard/Schedule/Embedded/Popups/MoveDeleteWorkOrder'

	if int(seq) <= 4: raise Exception("Current work order up to sequence 4 can't be moved.")
	else:
		system.perspective.print('Begin move workorder')
		params = { 'RowData': selectedRowData, 'ModalName': 'DeleteWO', 'Type': 'delete' }	
		system.perspective.openPopup('DeleteWO', popupPath, params)			
except Exception as e:
	gpa.frontEnd.localUI.throwError(e)
